def murmur3_x64_128(source: io.IOBase, seed: int) -> Optional[int]:
    C1 = 0x87c3_7b91_1142_53d5
    C2 = 0x4cf5_ad43_2745_937f
    C3 = 0x52dc_e729
    C4 = 0x3849_5ab5
    R1 = 27
    R2 = 31
    R3 = 33
    M = 5
    h1 = seed
    h2 = seed
    buf = bytearray(16)
    processed = 0

    def fmix64(k: int) -> int:
        C1 = 0xff51_afd7_ed55_8ccd
        C2 = 0xc4ce_b9fe_1a85_ec53
        R = 33
        tmp = k
        tmp ^= tmp >> R
        tmp = (tmp * C1) & ((1 << 64) - 1)
        tmp ^= tmp >> R
        tmp = (tmp * C2) & ((1 << 64) - 1)
        tmp ^= tmp >> R
        return tmp

    def copy_into_array(slice):
        return bytearray(slice)

    def read_bytes(source, buf):
        nonlocal processed
        offset = 0
        while True:
            try:
                data = source.readinto(memoryview(buf)[offset:])
                if data == 0:
                    return offset
                offset += data
                if offset == len(buf):
                    return offset
            except InterruptedError:
                pass
            except Exception as e:
                return None

    while True:
        read = read_bytes(source, buf)
        processed += read

        if read == 16:
            k1 = int.from_bytes(copy_into_array(buf[0:8]), byteorder='little')
            k2 = int.from_bytes(copy_into_array(buf[8:]), byteorder='little')
            h1 ^= k1 * C1 & ((1 << 64) - 1) >> R2 * C2
            h1 = ((h1 << R1) | (h1 >> (64 - R1))) + h2
            h1 = (h1 * M + C3) & ((1 << 64) - 1)
            h2 ^= k2 * C2 & ((1 << 64) - 1) >> R3 * C1
            h2 = ((h2 << R2) | (h2 >> (64 - R2))) + h1
            h2 = (h2 * M + C4) & ((1 << 64) - 1)
        elif read == 0:
            h1 ^= processed
            h2 ^= processed
            h1 += h2
            h2 += h1
            h1 = fmix64(h1)
            h2 = fmix64(h2)
            h1 += h2
            h2 += h1
            return (h2 << 64) + h1
        else:
            k1 = k2 = 0
            if read >= 15:
                k2 ^= buf[14] << 48
            if read >= 14:
                k2 ^= buf[13] << 40
            if read >= 13:
                k2 ^= buf[12] << 32
            if read >= 12:
                k2 ^= buf[11] << 24
            if read >= 11:
                k2 ^= buf[10] << 16
            if read >= 10:
                k2 ^= buf[9] << 8
            if read >= 9:
                k2 ^= buf[8]
                k2 = (k2 * C2 & ((1 << 64) - 1) << 33) * C1 & ((1 << 64) - 1)
                h2 ^= k2
            if read >= 8:
                k1 ^= buf[7] << 56
            if read >= 7:
                k1 ^= buf[6] << 48
            if read >= 6:
                k1 ^= buf[5] << 40
            if read >= 5:
                k1 ^= buf[4] << 32
            if read >= 4:
                k1 ^= buf[3] << 24
            if read >= 3:
                k1 ^= buf[2] << 16
            if read >= 2:
                k1 ^= buf[1] << 8
            if read >= 1:
                k1 ^= buf[0]
            k1 = (k1 * C1 & ((1 << 64) - 1) << 31) * C2 & ((1 << 64) - 1)
            h1 ^= k1


class ExClimbWuzhi:

    @staticmethod
    async def _get_b3_b4_Cookie(apiExClimbWuzhi: APIExClimbWuzhi = APIExClimbWuzhi(), useProxy=True):
        '''
        获取带有b3和b4的cookie
        :return:
        '''
        cookie = ['innersign=0',
                  'i-wanna-go-back=-1',
                  'b_ut=7',
                  'enable_web_push=DISABLE',
                  'header_theme_version=undefined',
                  'home_feed_column=4',
                  f'browser_resolution={apiExClimbWuzhi.browser_resolution.avail_h}-{apiExClimbWuzhi.browser_resolution.avail_w}',
                  f'buvid_fp={BuvidFp.gen(apiExClimbWuzhi)}'
                  ]

        cookie.append("=".join(['b_lsid', utils.lsid()]))
        apiExClimbWuzhi._uuid = UuidInfoc.gen()
        cookie.append("=".join(['_uuid', apiExClimbWuzhi._uuid]))
        cookie.append("=".join(['b_nut', str(int(time.time() * 1000))]))
        if useProxy:
            # response = await MYREQ.request_with_proxy(method="get", url=apiExClimbWuzhi.spi, headers={
            #     "Referer": 'https://www.bilibili.com/',
            #     "User-Agent": apiExClimbWuzhi.ua,
            #     "Cookie": "; ".join(cookie)
            # }
            #                                           )
            response = (await MyAsyncReq.request(method="get",
                                                 url=apiExClimbWuzhi.spi,
                                                 headers={
                                                     "Referer": 'https://www.bilibili.com/',
                                                     "User-Agent": apiExClimbWuzhi.ua,
                                                     "Cookie": "; ".join(cookie),
                                                 }, proxies={
                    'https': 'http://127.0.0.1:23998',
                    'http': 'http://127.0.0.1:23998',
                }
                                                 )).json()
        else:
            response = (await MyAsyncReq.request(method="get",
                                                 url=apiExClimbWuzhi.spi,
                                                 headers={
                                                     "Referer": 'https://www.bilibili.com/',
                                                     "User-Agent": apiExClimbWuzhi.ua,
                                                     "Cookie": "; ".join(cookie),
                                                 }, proxies={
                    'https': 'http://127.0.0.1:23998',
                    'http': 'http://127.0.0.1:23998',
                }
                                                 )).json()
        cookie.append("=".join(['buvid3', quote(response['data']['b_3'], safe='')]))
        cookie.append("=".join(['buvid4', quote(response['data']['b_4'], safe='')]))
        return "; ".join(cookie)

